INSERT INTO `chapters` (`chapter_id`, `sub_id`, `chapter_name`, `chapter_detail`, `contents`) VALUES
(1, 1, 'What is an Algorithm?', 'In this tutorial, we will learn what algorithms are with the help of examples.', '&lt;p&gt;Qualities of Good Algorithms&lt;/p&gt;&lt;ol&gt;&lt;li&gt;Input and output should be defined precisely.&lt;/li&gt;&lt;li&gt;Each step in the algorithm should be clear and unambiguous.&lt;/li&gt;&lt;li&gt;Algorithms should be most effective among many different ways to solve a problem.&lt;/li&gt;&lt;li&gt;An algorithm shouldn&amp;#39;t include computer code. Instead, the algorithm should be written in such a way that it can be used in different programming languages.&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;strong&gt;Algorithm Examples&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;em&gt;Algorithm 1: Add two numbers entered by the user&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;&lt;pre&gt;&lt;code&gt;Step 1: Start\r\nStep 2: Declare variables num1, num2 and sum. \r\nStep 3: Read values num1 and num2. \r\nStep 4: Add num1 and num2 and assign the result to sum.\r\n        sum&larr;num1+num2 \r\nStep 5: Display sum \r\nStep 6: Stop&lt;/code&gt;&lt;/pre&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;em&gt;Algorithm 2: Find the factorial of a number&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;&lt;pre&gt;&lt;code&gt;Step 1: Start\r\nStep 2: Declare variables n, factorial and i.\r\nStep 3: Initialize variables\r\n          factorial &larr; 1\r\n          i &larr; 1\r\nStep 4: Read value of n\r\nStep 5: Repeat the steps until i = n\r\n     5.1: factorial &larr; factorial*i\r\n     5.2: i &larr; i+1\r\nStep 6: Display factorial\r\nStep 7: Stop&lt;/code&gt;&lt;/pre&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Why Learn Data Structures and Algorithms?&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;Programming is all about data structures and algorithms. Data structures are used to hold data while algorithms are used to solve the problem using that data.&lt;/p&gt;&lt;p&gt;Data structures and algorithms (DSA) goes through solutions to standard problems in detail and gives you an insight into how efficient it is to use each one of them. It also teaches you the science of evaluating the efficiency of an algorithm. This enables you to choose the best of various choices.&lt;/p&gt;'),
(2, 1, 'Asymptotic Analysis', 'In this tutorial, you will learn what asymptotic notations are. Also, you will learn about Big-O notation, Theta notation and Omega notation.', '&lt;p&gt;&lt;em&gt;&lt;strong&gt;Asymptotic Notations&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;Asymptotic notations are the mathematical notations used to describe the running time of an algorithm when the input tends towards a particular value or a limiting value.&lt;/p&gt;&lt;p&gt;For example: In bubble sort, when the input array is already sorted, the time taken by the algorithm is linear i.e. the best case.&lt;/p&gt;&lt;p&gt;But, when the input array is in reverse condition, the algorithm takes the maximum time (quadratic) to sort the elements i.e. the worst case.&lt;/p&gt;&lt;p&gt;When the input array is neither sorted nor in reverse order, then it takes average time. These durations are denoted using asymptotic notations.&lt;/p&gt;&lt;p&gt;There are mainly three asymptotic notations:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Big-O notation&lt;/li&gt;&lt;li&gt;Omega notation&lt;/li&gt;&lt;li&gt;Theta notation&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Big-O Notation (O-notation)&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;Big-O notation represents the upper bound of the running time of an algorithm. Thus, it gives the worst-case complexity of an algorithm.&lt;/p&gt;&lt;figure class=&quot;image&quot;&gt;&lt;img alt=&quot;&quot; width=&quot;500&quot; height=&quot;500&quot; src=&quot;https://cdn.programiz.com/sites/tutorial2program/files/big0.png&quot; /&gt;&lt;figcaption&gt;Big-O gives the upper bound of a function&lt;/figcaption&gt;&lt;/figure&gt;&lt;p&gt;Since it gives the worst-case running time of an algorithm, it is widely used to analyze an algorithm as we are always interested in the worst-case scenario.&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Omega Notation (&amp;Omega;-notation)&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;Omega notation represents the lower bound of the running time of an algorithm. Thus, it provides the best case complexity of an algorithm.&lt;/p&gt;&lt;figure class=&quot;image&quot;&gt;&lt;img alt=&quot;&quot; width=&quot;500&quot; height=&quot;543&quot; src=&quot;https://cdn.programiz.com/sites/tutorial2program/files/omega.png&quot; /&gt;&lt;figcaption&gt;Omega gives the lower bound of a function&lt;/figcaption&gt;&lt;/figure&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Theta Notation (&amp;Theta;-notation)&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;Theta notation encloses the function from above and below. Since it represents the upper and the lower bound of the running time of an algorithm, it is used for analyzing the average-case complexity of an algorithm.&lt;/p&gt;&lt;figure class=&quot;image&quot;&gt;&lt;img alt=&quot;&quot; width=&quot;500&quot; height=&quot;535&quot; src=&quot;https://cdn.programiz.com/sites/tutorial2program/files/theta.png&quot; /&gt;&lt;figcaption&gt;Theta bounds the function within constants factors&lt;/figcaption&gt;&lt;/figure&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;'),
(3, 1, 'Stack Data Structure', 'In this tutorial, you will learn about the stack data structure and its implementation in  C/C++.', '&lt;p&gt;A stack is a useful data structure in programming. It is just like a pile of plates kept on top of each other.&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;LIFO Principle of Stack&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;figure class=&quot;image&quot;&gt;&lt;img alt=&quot;&quot; width=&quot;500&quot; height=&quot;296&quot; src=&quot;https://cdn.programiz.com/sites/tutorial2program/files/stack.png&quot; /&gt;&lt;figcaption&gt;Stack Push and Pop Operation&lt;/figcaption&gt;&lt;/figure&gt;&lt;p&gt;In programming terms, putting an item on top of the stack is called&amp;nbsp;&lt;strong&gt;push&lt;/strong&gt;&amp;nbsp;and removing an item is called&amp;nbsp;&lt;strong&gt;pop&lt;/strong&gt;.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Basic Operations of Stack&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;A stack is an object (an abstract data type - ADT) that allows the following operations:&lt;/p&gt;&lt;ol&gt;&lt;li&gt;&lt;strong&gt;Push&lt;/strong&gt;: Add an element to the top of a stack&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Pop&lt;/strong&gt;: Remove an element from the top of a stack&lt;/li&gt;&lt;li&gt;&lt;strong&gt;IsEmpty&lt;/strong&gt;: Check if the stack is empty&lt;/li&gt;&lt;li&gt;&lt;strong&gt;IsFull&lt;/strong&gt;: Check if the stack is full&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Peek&lt;/strong&gt;: Get the value of the top element without removing it&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Working of Stack Data Structure&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;The operations work as follows:&lt;/p&gt;&lt;ol&gt;&lt;li&gt;A pointer called&amp;nbsp;TOP&amp;nbsp;is used to keep track of the top element in the stack.&lt;/li&gt;&lt;li&gt;When initializing the stack, we set its value to -1 so that we can check if the stack is empty by comparing&amp;nbsp;&lt;code&gt;TOP == -1&lt;/code&gt;.&lt;/li&gt;&lt;li&gt;On pushing an element, we increase the value of&amp;nbsp;TOP&amp;nbsp;and place the new element in the position pointed to by&amp;nbsp;TOP.&lt;/li&gt;&lt;li&gt;On popping an element, we return the element pointed to by&amp;nbsp;TOP&amp;nbsp;and reduce its value.&lt;/li&gt;&lt;li&gt;Before pushing, we check if the stack is already full&lt;/li&gt;&lt;li&gt;Before popping, we check if the stack is already empty&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Stack Implementations in C++&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;pre&gt;&lt;code class=&quot;language-cpp&quot;&gt;// Stack implementation in C++\r\n\r\n#include &amp;lt;stdlib.h&amp;gt;\r\n#include &amp;lt;iostream&amp;gt;\r\n\r\nusing namespace std;\r\n\r\n#define MAX 10\r\nint size = 0;\r\n\r\n// Creating a stack\r\nstruct stack {\r\n  int items[MAX];\r\n  int top;\r\n};\r\ntypedef struct stack st;\r\n\r\nvoid createEmptyStack(st *s) {\r\n  s-&amp;gt;top = -1;\r\n}\r\n\r\n// Check if the stack is full\r\nint isfull(st *s) {\r\n  if (s-&amp;gt;top == MAX - 1)\r\n    return 1;\r\n  else\r\n    return 0;\r\n}\r\n\r\n// Check if the stack is empty\r\nint isempty(st *s) {\r\n  if (s-&amp;gt;top == -1)\r\n    return 1;\r\n  else\r\n    return 0;\r\n}\r\n\r\n// Add elements into stack\r\nvoid push(st *s, int newitem) {\r\n  if (isfull(s)) {\r\n    printf(&quot;STACK FULL&quot;);\r\n  } else {\r\n    s-&amp;gt;top++;\r\n    s-&amp;gt;items[s-&amp;gt;top] = newitem;\r\n  }\r\n  size++;\r\n}\r\n\r\n// Remove element from stack\r\nvoid pop(st *s) {\r\n  if (isempty(s)) {\r\n    printf(&quot;\\n STACK EMPTY \\n&quot;);\r\n  } else {\r\n    printf(&quot;Item popped= %d&quot;, s-&amp;gt;items[s-&amp;gt;top]);\r\n    s-&amp;gt;top--;\r\n  }\r\n  size--;\r\n  cout &amp;lt;&amp;lt; endl;\r\n}\r\n\r\n// Print elements of stack\r\nvoid printStack(st *s) {\r\n  printf(&quot;Stack: &quot;);\r\n  for (int i = 0; i &amp;lt; size; i++) {\r\n    cout &amp;lt;&amp;lt; s-&amp;gt;items[i] &amp;lt;&amp;lt; &quot; &quot;;\r\n  }\r\n  cout &amp;lt;&amp;lt; endl;\r\n}\r\n\r\n// Driver code\r\nint main() {\r\n  int ch;\r\n  st *s = (st *)malloc(sizeof(st));\r\n\r\n  createEmptyStack(s);\r\n\r\n  push(s, 1);\r\n  push(s, 2);\r\n  push(s, 3);\r\n  push(s, 4);\r\n\r\n  printStack(s);\r\n\r\n  pop(s);\r\n\r\n  cout &amp;lt;&amp;lt; &quot;\\nAfter popping out\\n&quot;;\r\n  printStack(s);\r\n}&lt;/code&gt;&lt;/pre&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Stack Time Complexity&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;For the array-based implementation of a stack, the push and pop operations take constant time, i.e.&amp;nbsp;&lt;code&gt;O(1)&lt;/code&gt;.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Applications of Stack Data Structure&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;Although stack is a simple data structure to implement, it is very powerful. The most common uses of a stack are:&lt;/p&gt;&lt;ol&gt;&lt;li&gt;&lt;strong&gt;To reverse a word&lt;/strong&gt;&amp;nbsp;- Put all the letters in a stack and pop them out. Because of the LIFO order of stack, you will get the letters in reverse order.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;In compilers&lt;/strong&gt;&amp;nbsp;- Compilers use the stack to calculate the value of expressions like&amp;nbsp;&lt;code&gt;2 + 4 / 5 * (7 - 9)&lt;/code&gt;&amp;nbsp;by converting the expression to prefix or postfix form.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;In browsers&lt;/strong&gt;&amp;nbsp;- The back button in a browser saves all the URLs you have visited previously in a stack. Each time you visit a new page, it is added on top of the stack. When you press the back button, the current URL is removed from the stack, and the previous URL is accessed.&lt;/li&gt;&lt;/ol&gt;'),
(4, 1, 'Queue Data Structure', 'In this tutorial, you will learn what a queue is. Also, you will find implementation of queue in C++.', '&lt;p&gt;A queue is a useful data structure in programming. It is similar to the ticket queue outside a cinema hall, where the first person entering the queue is the first person who gets the ticket.&lt;/p&gt;&lt;p&gt;Queue follows the&amp;nbsp;&lt;strong&gt;First In First Out (FIFO)&lt;/strong&gt;&amp;nbsp;rule - the item that goes in first is the item that comes out first.&lt;/p&gt;&lt;figure class=&quot;image&quot;&gt;&lt;img alt=&quot;&quot; width=&quot;500&quot; height=&quot;78&quot; src=&quot;https://cdn.programiz.com/sites/tutorial2program/files/queue.png&quot; /&gt;&lt;figcaption&gt;FIFO Representation of Queue&lt;/figcaption&gt;&lt;/figure&gt;&lt;p&gt;In programming terms, putting items in the queue is called&amp;nbsp;&lt;strong&gt;enqueue&lt;/strong&gt;, and removing items from the queue is called&amp;nbsp;&lt;strong&gt;dequeue&lt;/strong&gt;.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Basic Operations of Queue&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;A queue is an object (an abstract data structure - ADT) that allows the following operations:&lt;/p&gt;&lt;ol&gt;&lt;li&gt;&lt;strong&gt;Enqueue&lt;/strong&gt;: Add an element to the end of the queue&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Dequeue&lt;/strong&gt;: Remove an element from the front of the queue&lt;/li&gt;&lt;li&gt;&lt;strong&gt;IsEmpty&lt;/strong&gt;: Check if the queue is empty&lt;/li&gt;&lt;li&gt;&lt;strong&gt;IsFull&lt;/strong&gt;: Check if the queue is full&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Peek&lt;/strong&gt;: Get the value of the front of the queue without removing it&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Working of Queue&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;Queue operations work as follows:&lt;/p&gt;&lt;ol&gt;&lt;li&gt;two pointers&amp;nbsp;FRONT&amp;nbsp;and&amp;nbsp;REAR&lt;/li&gt;&lt;li&gt;FRONT&amp;nbsp;track the first element of the queue&lt;/li&gt;&lt;li&gt;REAR&amp;nbsp;track the last element of the queue&lt;/li&gt;&lt;li&gt;initially, set value of&amp;nbsp;FRONT&amp;nbsp;and&amp;nbsp;REAR&amp;nbsp;to -1&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Enqueue Operation&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;ol&gt;&lt;li&gt;check if the queue is full&lt;/li&gt;&lt;li&gt;for the first element, set the value of&amp;nbsp;FRONT&amp;nbsp;to 0&lt;/li&gt;&lt;li&gt;increase the&amp;nbsp;REAR&amp;nbsp;index by 1&lt;/li&gt;&lt;li&gt;add the new element in the position pointed to by&amp;nbsp;REAR&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Dequeue Operation&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;ol&gt;&lt;li&gt;check if the queue is empty&lt;/li&gt;&lt;li&gt;return the value pointed by&amp;nbsp;FRONT&lt;/li&gt;&lt;li&gt;increase the&amp;nbsp;FRONT&amp;nbsp;index by 1&lt;/li&gt;&lt;li&gt;for the last element, reset the values of&amp;nbsp;FRONT&amp;nbsp;and&amp;nbsp;REAR&amp;nbsp;to -1&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Queue Implementations in C++&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;We usually use arrays to implement queues in C/++.&lt;/p&gt;&lt;pre&gt;&lt;code class=&quot;language-cpp&quot;&gt;// Queue implementation in C++\r\n\r\n#include &amp;lt;iostream&amp;gt;\r\n#define SIZE 5\r\n\r\nusing namespace std;\r\n\r\nclass Queue {\r\n   private:\r\n  int items[SIZE], front, rear;\r\n\r\n   public:\r\n  Queue() {\r\n    front = -1;\r\n    rear = -1;\r\n  }\r\n\r\n  bool isFull() {\r\n    if (front == 0 &amp;amp;&amp;amp; rear == SIZE - 1) {\r\n      return true;\r\n    }\r\n    return false;\r\n  }\r\n\r\n  bool isEmpty() {\r\n    if (front == -1)\r\n      return true;\r\n    else\r\n      return false;\r\n  }\r\n\r\n  void enQueue(int element) {\r\n    if (isFull()) {\r\n      cout &amp;lt;&amp;lt; &quot;Queue is full&quot;;\r\n    } else {\r\n      if (front == -1) front = 0;\r\n      rear++;\r\n      items[rear] = element;\r\n      cout &amp;lt;&amp;lt; endl\r\n         &amp;lt;&amp;lt; &quot;Inserted &quot; &amp;lt;&amp;lt; element &amp;lt;&amp;lt; endl;\r\n    }\r\n  }\r\n\r\n  int deQueue() {\r\n    int element;\r\n    if (isEmpty()) {\r\n      cout &amp;lt;&amp;lt; &quot;Queue is empty&quot; &amp;lt;&amp;lt; endl;\r\n      return (-1);\r\n    } else {\r\n      element = items[front];\r\n      if (front &amp;gt;= rear) {\r\n        front = -1;\r\n        rear = -1;\r\n      } /* Q has only one element, so we reset the queue after deleting it. */\r\n      else {\r\n        front++;\r\n      }\r\n      cout &amp;lt;&amp;lt; endl\r\n         &amp;lt;&amp;lt; &quot;Deleted -&amp;gt; &quot; &amp;lt;&amp;lt; element &amp;lt;&amp;lt; endl;\r\n      return (element);\r\n    }\r\n  }\r\n\r\n  void display() {\r\n    /* Function to display elements of Queue */\r\n    int i;\r\n    if (isEmpty()) {\r\n      cout &amp;lt;&amp;lt; endl\r\n         &amp;lt;&amp;lt; &quot;Empty Queue&quot; &amp;lt;&amp;lt; endl;\r\n    } else {\r\n      cout &amp;lt;&amp;lt; endl\r\n         &amp;lt;&amp;lt; &quot;Front index-&amp;gt; &quot; &amp;lt;&amp;lt; front;\r\n      cout &amp;lt;&amp;lt; endl\r\n         &amp;lt;&amp;lt; &quot;Items -&amp;gt; &quot;;\r\n      for (i = front; i &amp;lt;= rear; i++)\r\n        cout &amp;lt;&amp;lt; items[i] &amp;lt;&amp;lt; &quot;  &quot;;\r\n      cout &amp;lt;&amp;lt; endl\r\n         &amp;lt;&amp;lt; &quot;Rear index-&amp;gt; &quot; &amp;lt;&amp;lt; rear &amp;lt;&amp;lt; endl;\r\n    }\r\n  }\r\n};\r\n\r\nint main() {\r\n  Queue q;\r\n\r\n  //deQueue is not possible on empty queue\r\n  q.deQueue();\r\n\r\n  //enQueue 5 elements\r\n  q.enQueue(1);\r\n  q.enQueue(2);\r\n  q.enQueue(3);\r\n  q.enQueue(4);\r\n  q.enQueue(5);\r\n\r\n  // 6th element can\'t be added to because the queue is full\r\n  q.enQueue(6);\r\n\r\n  q.display();\r\n\r\n  //deQueue removes element entered first i.e. 1\r\n  q.deQueue();\r\n\r\n  //Now we have just 4 elements\r\n  q.display();\r\n\r\n  return 0;\r\n}&lt;/code&gt;&lt;/pre&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Limitations of Queue&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;As you can see in the image below, after a bit of enqueuing and dequeuing, the size of the queue has been reduced.&lt;/p&gt;&lt;p&gt;&lt;img alt=&quot;&quot; width=&quot;500&quot; height=&quot;264&quot; src=&quot;https://cdn.programiz.com/sites/tutorial2program/files/why-circular-queue_0.png&quot; /&gt;&lt;/p&gt;&lt;p&gt;And we can only add indexes 0 and 1 only when the queue is reset (when all the elements have been dequeued).&lt;/p&gt;&lt;p&gt;After&amp;nbsp;REAR&amp;nbsp;reaches the last index, if we can store extra elements in the empty spaces (0 and 1), we can make use of the empty spaces. This is implemented by a modified queue called the circular queue.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Complexity Analysis&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;The complexity of enqueue and dequeue operations in a queue using an array is&amp;nbsp;&lt;code&gt;O(1)&lt;/code&gt;.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Applications of Queue&lt;/strong&gt;&lt;/p&gt;&lt;ol&gt;&lt;li&gt;CPU scheduling, Disk Scheduling&lt;/li&gt;&lt;li&gt;When data is transferred asynchronously between two processes.The queue is used for synchronization. For example: IO Buffers, pipes, file IO, etc&lt;/li&gt;&lt;li&gt;Handling of interrupts in real-time systems.&lt;/li&gt;&lt;li&gt;Call Center phone systems use Queues to hold people calling them in order.&lt;/li&gt;&lt;/ol&gt;'),
(5, 1, 'Circular Queue Data Structure', 'In this tutorial, you will learn what a circular queue is. Also, you will find implementation of circular queue in C++.', '&lt;p&gt;Circular queue avoids the wastage of space in a&amp;nbsp;regular queue implementation using arrays.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;How Circular Queue Works&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;Circular Queue works by the process of circular increment i.e. when we try to increment the pointer and we reach the end of the queue, we start from the beginning of the queue.&lt;/p&gt;&lt;p&gt;Here, the circular increment is performed by modulo division with the queue size. That is,&lt;/p&gt;&lt;pre&gt;&lt;code&gt;if REAR + 1 == 5 (overflow!), REAR = (REAR + 1)%5 = 0 (start of queue)\r\n&lt;/code&gt;&lt;/pre&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Circular Queue Operations&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;The circular queue work as follows:&lt;/p&gt;&lt;ol&gt;&lt;li&gt;two pointers&amp;nbsp;FRONT&amp;nbsp;and&amp;nbsp;REAR&lt;/li&gt;&lt;li&gt;FRONT&amp;nbsp;track the first element of the queue&lt;/li&gt;&lt;li&gt;REAR&amp;nbsp;track the last elements of the queue&lt;/li&gt;&lt;li&gt;initially, set value of&amp;nbsp;FRONT&amp;nbsp;and&amp;nbsp;REAR&amp;nbsp;to -1&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;strong&gt;&lt;em&gt;1. Enqueue Operation&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;&lt;ol&gt;&lt;li&gt;check if the queue is full&lt;/li&gt;&lt;li&gt;for the first element, set value of&amp;nbsp;FRONT&amp;nbsp;to 0&lt;/li&gt;&lt;li&gt;circularly increase the&amp;nbsp;REAR&amp;nbsp;index by 1 (i.e. if the rear reaches the end, next it would be at the start of the queue)&lt;/li&gt;&lt;li&gt;add the new element in the position pointed to by&amp;nbsp;REAR&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;2. Dequeue Operation&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;ol&gt;&lt;li&gt;check if the queue is empty&lt;/li&gt;&lt;li&gt;return the value pointed by&amp;nbsp;FRONT&lt;/li&gt;&lt;li&gt;circularly increase the&amp;nbsp;FRONT&amp;nbsp;index by 1&lt;/li&gt;&lt;li&gt;for the last element, reset the values of&amp;nbsp;FRONT&amp;nbsp;and&amp;nbsp;REAR&amp;nbsp;to -1&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;However, the check for full queue has a new additional case:&lt;/p&gt;&lt;ol&gt;&lt;li&gt;Case 1:&amp;nbsp;FRONT&amp;nbsp;= 0 &amp;amp;&amp;amp;&amp;nbsp;&lt;code&gt;REAR == SIZE - 1&lt;/code&gt;&lt;/li&gt;&lt;li&gt;Case 2:&amp;nbsp;&lt;code&gt;FRONT = REAR + 1&lt;/code&gt;&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;The second case happens when&amp;nbsp;REAR&amp;nbsp;starts from 0 due to circular increment and when its value is just 1 less than&amp;nbsp;FRONT, the queue is full.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Circular Queue Implementations in C++&lt;/p&gt;&lt;pre&gt;&lt;code class=&quot;language-cpp&quot;&gt;// Circular Queue implementation in C++\r\n\r\n#include &amp;lt;iostream&amp;gt;\r\n#define SIZE 5 /* Size of Circular Queue */\r\n\r\nusing namespace std;\r\n\r\nclass Queue {\r\n   private:\r\n  int items[SIZE], front, rear;\r\n\r\n   public:\r\n  Queue() {\r\n    front = -1;\r\n    rear = -1;\r\n  }\r\n  // Check if the queue is full\r\n  bool isFull() {\r\n    if (front == 0 &amp;amp;&amp;amp; rear == SIZE - 1) {\r\n      return true;\r\n    }\r\n    if (front == rear + 1) {\r\n      return true;\r\n    }\r\n    return false;\r\n  }\r\n  // Check if the queue is empty\r\n  bool isEmpty() {\r\n    if (front == -1)\r\n      return true;\r\n    else\r\n      return false;\r\n  }\r\n  // Adding an element\r\n  void enQueue(int element) {\r\n    if (isFull()) {\r\n      cout &amp;lt;&amp;lt; &quot;Queue is full&quot;;\r\n    } else {\r\n      if (front == -1) front = 0;\r\n      rear = (rear + 1) % SIZE;\r\n      items[rear] = element;\r\n      cout &amp;lt;&amp;lt; endl\r\n         &amp;lt;&amp;lt; &quot;Inserted &quot; &amp;lt;&amp;lt; element &amp;lt;&amp;lt; endl;\r\n    }\r\n  }\r\n  // Removing an element\r\n  int deQueue() {\r\n    int element;\r\n    if (isEmpty()) {\r\n      cout &amp;lt;&amp;lt; &quot;Queue is empty&quot; &amp;lt;&amp;lt; endl;\r\n      return (-1);\r\n    } else {\r\n      element = items[front];\r\n      if (front == rear) {\r\n        front = -1;\r\n        rear = -1;\r\n      }\r\n      // Q has only one element,\r\n      // so we reset the queue after deleting it.\r\n      else {\r\n        front = (front + 1) % SIZE;\r\n      }\r\n      return (element);\r\n    }\r\n  }\r\n\r\n  void display() {\r\n    // Function to display status of Circular Queue\r\n    int i;\r\n    if (isEmpty()) {\r\n      cout &amp;lt;&amp;lt; endl\r\n         &amp;lt;&amp;lt; &quot;Empty Queue&quot; &amp;lt;&amp;lt; endl;\r\n    } else {\r\n      cout &amp;lt;&amp;lt; &quot;Front -&amp;gt; &quot; &amp;lt;&amp;lt; front;\r\n      cout &amp;lt;&amp;lt; endl\r\n         &amp;lt;&amp;lt; &quot;Items -&amp;gt; &quot;;\r\n      for (i = front; i != rear; i = (i + 1) % SIZE)\r\n        cout &amp;lt;&amp;lt; items[i];\r\n      cout &amp;lt;&amp;lt; items[i];\r\n      cout &amp;lt;&amp;lt; endl\r\n         &amp;lt;&amp;lt; &quot;Rear -&amp;gt; &quot; &amp;lt;&amp;lt; rear;\r\n    }\r\n  }\r\n};\r\n\r\nint main() {\r\n  Queue q;\r\n\r\n  // Fails because front = -1\r\n  q.deQueue();\r\n\r\n  q.enQueue(1);\r\n  q.enQueue(2);\r\n  q.enQueue(3);\r\n  q.enQueue(4);\r\n  q.enQueue(5);\r\n\r\n  // Fails to enqueue because front == 0 &amp;amp;&amp;amp; rear == SIZE - 1\r\n  q.enQueue(6);\r\n\r\n  q.display();\r\n\r\n  int elem = q.deQueue();\r\n\r\n  if (elem != -1)\r\n    cout &amp;lt;&amp;lt; endl\r\n       &amp;lt;&amp;lt; &quot;Deleted Element is &quot; &amp;lt;&amp;lt; elem;\r\n\r\n  q.display();\r\n\r\n  q.enQueue(7);\r\n\r\n  q.display();\r\n\r\n  // Fails to enqueue because front == rear + 1\r\n  q.enQueue(8);\r\n\r\n  return 0;\r\n}&lt;/code&gt;&lt;/pre&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Circular Queue Complexity Analysis&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;The complexity of the enqueue and dequeue operations of a circular queue is&amp;nbsp;O(1)&amp;nbsp;for (array implementations).&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Applications of Circular Queue&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;ol&gt;&lt;li&gt;CPU scheduling&lt;/li&gt;&lt;li&gt;Memory management&lt;/li&gt;&lt;li&gt;Traffic Management&lt;/li&gt;&lt;/ol&gt;'),
(9, 1, 'Deque Data Structure', 'In this tutorial, you will learn what a double ended queue (deque) is. Also, you will find working examples of different operations on a deque in C++.', '&lt;p&gt;Deque or Double Ended Queue is a type of queue&amp;nbsp;in which insertion and removal of elements can be performed from either from the front or rear. Thus, it does not follow FIFO rule (First In First Out).&lt;/p&gt;&lt;p&gt;&lt;img alt=&quot;&quot; width=&quot;500&quot; height=&quot;80&quot; src=&quot;https://cdn.programiz.com/sites/tutorial2program/files/deque.png&quot; /&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Types of Deque&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;ol&gt;&lt;li&gt;&lt;strong&gt;Input Restricted Deque&lt;/strong&gt;&lt;br /&gt;In this deque, input is restricted at a single end but allows deletion at both the ends.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Output Restricted Deque&lt;/strong&gt;&lt;br /&gt;In this deque, output is restricted at a single end but allows insertion at both the ends.&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Operations on a Deque&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;Below is the circular array implementation of deque. In a circular array, if the array is full, we start from the beginning.&lt;/p&gt;&lt;p&gt;But in a linear array implementation, if the array is full, no more elements can be inserted. In each of the operations below, if the array is full, &amp;quot;overflow message&amp;quot; is thrown.&lt;/p&gt;&lt;p&gt;Before performing the following operations, these steps are followed.&lt;/p&gt;&lt;ol&gt;&lt;li&gt;Take an array (deque) of size&amp;nbsp;n.&lt;/li&gt;&lt;li&gt;Set two pointers at the first position and set&amp;nbsp;&lt;code&gt;front = -1&lt;/code&gt;&amp;nbsp;and&amp;nbsp;&lt;code&gt;rear = 0&lt;/code&gt;.&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;1. Insert at the Front&lt;/strong&gt;&lt;/em&gt;&lt;br /&gt;This operation adds an element at the front.&lt;/p&gt;&lt;ol&gt;&lt;li&gt;Check the position of front.&lt;/li&gt;&lt;li&gt;If front &amp;lt; 1, reinitialize front = n-1 (last index).&lt;/li&gt;&lt;li&gt;Else, decrease front by 1.&lt;/li&gt;&lt;li&gt;Add the new key 5 into array[front].&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;2. Insert at the Rear&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;This operation adds an element to the rear.&lt;/p&gt;&lt;ol&gt;&lt;li&gt;Check if the array is full.&lt;/li&gt;&lt;li&gt;If the deque is full, reinitialize&amp;nbsp;&lt;code&gt;rear = 0&lt;/code&gt;.&lt;/li&gt;&lt;li&gt;Else, increase&amp;nbsp;rear&amp;nbsp;by 1.&lt;/li&gt;&lt;li&gt;Add the new key&amp;nbsp;5&amp;nbsp;into&amp;nbsp;&lt;code&gt;array[rear]&lt;/code&gt;.&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;3. Delete from the Front&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;The operation deletes an element from the front.&lt;/p&gt;&lt;ol&gt;&lt;li&gt;Check if the deque is empty.&lt;/li&gt;&lt;li&gt;If the deque is empty (i.e.&amp;nbsp;&lt;code&gt;front = -1&lt;/code&gt;), deletion cannot be performed (&lt;strong&gt;underflow condition&lt;/strong&gt;).&lt;/li&gt;&lt;li&gt;If the deque has only one element (i.e.&amp;nbsp;&lt;code&gt;front = rear&lt;/code&gt;), set&amp;nbsp;&lt;code&gt;front = -1&lt;/code&gt;&amp;nbsp;and&amp;nbsp;&lt;code&gt;rear = -1&lt;/code&gt;.&lt;/li&gt;&lt;li&gt;Else if&amp;nbsp;front&amp;nbsp;is at the end (i.e.&amp;nbsp;&lt;code&gt;front = n - 1&lt;/code&gt;), set go to the front&amp;nbsp;&lt;code&gt;front = 0&lt;/code&gt;.&lt;/li&gt;&lt;li&gt;Else,&amp;nbsp;&lt;code&gt;front = front + 1&lt;/code&gt;.&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;4. Delete from the Rear&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;This operation deletes an element from the rear.&lt;/p&gt;&lt;ol&gt;&lt;li&gt;Check if the deque is empty.&lt;/li&gt;&lt;li&gt;If the deque is empty (i.e.&amp;nbsp;&lt;code&gt;front = -1&lt;/code&gt;), deletion cannot be performed (&lt;strong&gt;underflow condition&lt;/strong&gt;).&lt;/li&gt;&lt;li&gt;If the deque has only one element (i.e.&amp;nbsp;&lt;code&gt;front = rear&lt;/code&gt;), set&amp;nbsp;&lt;code&gt;front = -1&lt;/code&gt;&amp;nbsp;and&amp;nbsp;&lt;code&gt;rear = -1&lt;/code&gt;, else follow the steps below.&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;5. Check Empty&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;This operation checks if the deque is empty. If&amp;nbsp;&lt;code&gt;front = -1&lt;/code&gt;, the deque is empty.&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;6. Check Full&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;This operation checks if the deque is full. If&amp;nbsp;&lt;code&gt;front = 0&lt;/code&gt;&amp;nbsp;and&amp;nbsp;&lt;code&gt;rear = n - 1&lt;/code&gt;&amp;nbsp;OR&amp;nbsp;&lt;code&gt;front = rear + 1&lt;/code&gt;, the deque is full.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Deque Implementation in C++&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;pre&gt;&lt;code class=&quot;language-cpp&quot;&gt;// Deque implementation in C++\r\n\r\n#include &amp;lt;iostream&amp;gt;\r\nusing namespace std;\r\n\r\n#define MAX 10\r\n\r\nclass Deque {\r\n  int arr[MAX];\r\n  int front;\r\n  int rear;\r\n  int size;\r\n\r\n   public:\r\n  Deque(int size) {\r\n    front = -1;\r\n    rear = 0;\r\n    this-&amp;gt;size = size;\r\n  }\r\n\r\n  void insertfront(int key);\r\n  void insertrear(int key);\r\n  void deletefront();\r\n  void deleterear();\r\n  bool isFull();\r\n  bool isEmpty();\r\n  int getFront();\r\n  int getRear();\r\n};\r\n\r\nbool Deque::isFull() {\r\n  return ((front == 0 &amp;amp;&amp;amp; rear == size - 1) ||\r\n      front == rear + 1);\r\n}\r\n\r\nbool Deque::isEmpty() {\r\n  return (front == -1);\r\n}\r\n\r\nvoid Deque::insertfront(int key) {\r\n  if (isFull()) {\r\n    cout &amp;lt;&amp;lt; &quot;Overflow\\n&quot;\r\n       &amp;lt;&amp;lt; endl;\r\n    return;\r\n  }\r\n\r\n  if (front == -1) {\r\n    front = 0;\r\n    rear = 0;\r\n  }\r\n\r\n  else if (front == 0)\r\n    front = size - 1;\r\n\r\n  else\r\n    front = front - 1;\r\n\r\n  arr[front] = key;\r\n}\r\n\r\nvoid Deque ::insertrear(int key) {\r\n  if (isFull()) {\r\n    cout &amp;lt;&amp;lt; &quot; Overflow\\n &quot; &amp;lt;&amp;lt; endl;\r\n    return;\r\n  }\r\n\r\n  if (front == -1) {\r\n    front = 0;\r\n    rear = 0;\r\n  }\r\n\r\n  else if (rear == size - 1)\r\n    rear = 0;\r\n\r\n  else\r\n    rear = rear + 1;\r\n\r\n  arr[rear] = key;\r\n}\r\n\r\nvoid Deque ::deletefront() {\r\n  if (isEmpty()) {\r\n    cout &amp;lt;&amp;lt; &quot;Queue Underflow\\n&quot;\r\n       &amp;lt;&amp;lt; endl;\r\n    return;\r\n  }\r\n\r\n  if (front == rear) {\r\n    front = -1;\r\n    rear = -1;\r\n  } else if (front == size - 1)\r\n    front = 0;\r\n\r\n  else\r\n    front = front + 1;\r\n}\r\n\r\nvoid Deque::deleterear() {\r\n  if (isEmpty()) {\r\n    cout &amp;lt;&amp;lt; &quot; Underflow\\n&quot;\r\n       &amp;lt;&amp;lt; endl;\r\n    return;\r\n  }\r\n\r\n  if (front == rear) {\r\n    front = -1;\r\n    rear = -1;\r\n  } else if (rear == 0)\r\n    rear = size - 1;\r\n  else\r\n    rear = rear - 1;\r\n}\r\n\r\nint Deque::getFront() {\r\n  if (isEmpty()) {\r\n    cout &amp;lt;&amp;lt; &quot; Underflow\\n&quot;\r\n       &amp;lt;&amp;lt; endl;\r\n    return -1;\r\n  }\r\n  return arr[front];\r\n}\r\n\r\nint Deque::getRear() {\r\n  if (isEmpty() || rear &amp;lt; 0) {\r\n    cout &amp;lt;&amp;lt; &quot; Underflow\\n&quot;\r\n       &amp;lt;&amp;lt; endl;\r\n    return -1;\r\n  }\r\n  return arr[rear];\r\n}\r\n\r\nint main() {\r\n  Deque dq(4);\r\n\r\n  cout &amp;lt;&amp;lt; &quot;insert element at rear end \\n&quot;;\r\n  dq.insertrear(5);\r\n  dq.insertrear(11);\r\n\r\n  cout &amp;lt;&amp;lt; &quot;rear element: &quot;\r\n     &amp;lt;&amp;lt; dq.getRear() &amp;lt;&amp;lt; endl;\r\n\r\n  dq.deleterear();\r\n  cout &amp;lt;&amp;lt; &quot;after deletion of the rear element, the new rear element: &quot; &amp;lt;&amp;lt; dq.getRear() &amp;lt;&amp;lt; endl;\r\n\r\n  cout &amp;lt;&amp;lt; &quot;insert element at front end \\n&quot;;\r\n\r\n  dq.insertfront(8);\r\n\r\n  cout &amp;lt;&amp;lt; &quot;front element: &quot; &amp;lt;&amp;lt; dq.getFront() &amp;lt;&amp;lt; endl;\r\n\r\n  dq.deletefront();\r\n\r\n  cout &amp;lt;&amp;lt; &quot;after deletion of front element new front element: &quot; &amp;lt;&amp;lt; dq.getFront() &amp;lt;&amp;lt; endl;\r\n}&lt;/code&gt;&lt;/pre&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Time Complexity&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;p&gt;The time complexity of all the above operations is constant i.e.&amp;nbsp;&lt;code&gt;O(1)&lt;/code&gt;.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;em&gt;&lt;strong&gt;Applications of Deque Data Structure&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;&lt;ol&gt;&lt;li&gt;In undo operations on software.&lt;/li&gt;&lt;li&gt;To store history in browsers.&lt;/li&gt;&lt;li&gt;For implementing both stacks and queues&lt;/li&gt;&lt;/ol&gt;'),
(10, 2, 'C Data Types', 'In this tutorial, you will learn about basic data types such as int, float, char etc. in C programming.', '<p>&nbsp;&nbsp;</p><p>In C programming, data types are declarations for variables. This determines the type and size of data associated with variables. For example,</p><pre><code class=\"language-cpp\">int myVar;</code></pre><p>Here,&nbsp;myVar&nbsp;is a variable of&nbsp;<code>int</code>&nbsp;(integer) type. The size of&nbsp;<code>int</code>&nbsp;is 4 bytes.</p><p>&nbsp;</p><p><em><strong>int</strong></em></p><p>Integers are whole numbers that can have both zero, positive and negative values but no decimal values. For example,&nbsp;<code>0</code>,&nbsp;<code>-5</code>,&nbsp;<code>10</code></p><p>We can use&nbsp;<code>int</code>&nbsp;for declaring an integer variable.</p><pre><code class=\"language-cpp\">int id, age;\r\n</code></pre><p>The size of&nbsp;<code>int</code>&nbsp;is usually 4 bytes (32 bits). And, it can take&nbsp;<code>232</code>&nbsp;distinct states from&nbsp;<code>-2147483648</code>&nbsp;to&nbsp;<code>2147483647</code>.</p><p>&nbsp;</p><p><em><strong>float and double</strong></em></p><p><code>float</code>&nbsp;and&nbsp;<code>double</code>&nbsp;are used to hold real numbers.</p><pre><code class=\"language-cpp\">float salary;\r\ndouble price;</code></pre><p>What&#39;s the difference between&nbsp;<code>float</code>&nbsp;and&nbsp;<code>double</code>?</p><p>The size of&nbsp;<code>float</code>&nbsp;(single precision float data type) is 4 bytes. And the size of&nbsp;<code>double</code>&nbsp;(double precision float data type) is 8 bytes.</p><p>&nbsp;</p><p><em><strong>char</strong></em></p><p>Keyword&nbsp;<code>char</code>&nbsp;is used for declaring character type variables. For example,</p><pre><code class=\"language-cpp\">char test = \'h\';\r\n</code></pre><p>The size of the character variable is 1 byte.</p><p>&nbsp;</p><p><em><strong>void</strong></em></p><p><code>void</code>&nbsp;is an incomplete type. It means &quot;nothing&quot; or &quot;no type&quot;. You can think of void as&nbsp;<strong>absent</strong>.</p><p>For example, if a function is not returning anything, its return type should be&nbsp;<code>void</code>.</p><p>Note that, you cannot create variables of&nbsp;<code>void</code>&nbsp;type.</p><p>&nbsp;</p><p><em><strong>short and long</strong></em></p><p>If you need to use a large number, you can use a type specifier&nbsp;<code>long</code>. Here&#39;s how:</p><pre><code class=\"language-cpp\">long a;\r\nlong long b;\r\nlong double c;</code></pre><p>Here variables&nbsp;a&nbsp;and&nbsp;b&nbsp;can store integer values. And,&nbsp;c&nbsp;can store a floating-point number.</p><p>If you are sure, only a small integer (<code>[&minus;32,767, +32,767]</code>&nbsp;range) will be used, you can use&nbsp;<code>short</code>.</p><pre><code class=\"language-cpp\">short d;\r\n</code></pre><p>&nbsp;</p><p><em><strong>signed and unsigned</strong></em></p><p>In C,&nbsp;<code>signed</code>&nbsp;and&nbsp;<code>unsigned</code>&nbsp;are type modifiers. You can alter the data storage of a data type by using them. For example,</p><pre><code class=\"language-cpp\">unsigned int x;\r\nint y;</code></pre><p>Here, the variable&nbsp;x&nbsp;can hold only zero and positive values because we have used the&nbsp;<code>unsigned</code>&nbsp;modifier.</p><p>Considering the size of&nbsp;<code>int</code>&nbsp;is 4 bytes, variable&nbsp;y&nbsp;can hold values from<span class=\"math-tex\">\\(2^{-31} \\)</span>&nbsp;to&nbsp;<span class=\"math-tex\">\\(2^{31}\\)</span><code>-1</code>, whereas variable&nbsp;x&nbsp;can hold values from&nbsp;<code>0</code>&nbsp;to&nbsp;<span class=\"math-tex\">\\(2^{32}\\)</span><code>-1</code>.</p><p>&nbsp;</p><p>Other data types defined in C programming are:</p><ol><li>bool Type</li><li>Enumerated type</li><li>Complex types</li></ol><p>&nbsp;</p><p><em><strong>Derived Data Types</strong></em></p><p>Data types that are derived from fundamental data types are derived types. For example: arrays, pointers, function types, structures, etc.</p>'),
(11, 2, 'C Input Output (I/O)', 'In this tutorial, you will learn to use scanf() function to take input from the user, and printf() function to display output to the user.', '<p>&nbsp;</p><p>C Output</p><p>In C programming,&nbsp;<code>printf()</code>&nbsp;is one of the main output function. The function sends formatted output to the screen. For example,</p><p><strong>Example 1: C Output</strong></p><pre><code class=\"language-cpp\">#include &lt;stdio.h&gt;    \r\nint main()\r\n{ \r\n    // Displays the string inside quotations\r\n    printf(\"C Programming\");\r\n    return 0;\r\n}</code></pre><p><strong>Output</strong></p><pre><code>C Programming\r\n</code></pre><p>&nbsp;</p><p>How does this program work?</p><ol><li>All valid C programs must contain the&nbsp;<code>main()</code>&nbsp;function. The code execution begins from the start of the&nbsp;<code>main()</code>&nbsp;function.</li><li>The&nbsp;<code>printf()</code>&nbsp;is a library function to send formatted output to the screen. The function prints the string inside quotations.</li><li>To use&nbsp;<code>printf()</code>&nbsp;in our program, we need to include&nbsp;<code>stdio.h</code>&nbsp;header file using the&nbsp;<code>#include &lt;stdio.h&gt;</code>&nbsp;statement.</li><li>The&nbsp;<code>return 0;</code>&nbsp;statement inside the&nbsp;<code>main()</code>&nbsp;function is the &quot;Exit status&quot; of the program. It&#39;s optional.</li></ol><p>&nbsp;</p><p><strong>Example 2: Integer Output</strong></p><pre><code class=\"language-cpp\">#include &lt;stdio.h&gt;\r\nint main()\r\n{\r\n    int testInteger = 5;\r\n    printf(\"Number = %d\", testInteger);\r\n    return 0;\r\n}</code></pre><p><strong>Output</strong></p><pre><code>Number = 5\r\n</code></pre><p>We use&nbsp;<code>%d</code>&nbsp;format specifier to print&nbsp;<code>int</code>&nbsp;types. Here, the&nbsp;<code>%d</code>&nbsp;inside the quotations will be replaced by the value of&nbsp;testInteger.</p><p>&nbsp;</p><p><em><strong>Example 3: float and double Output</strong></em></p><pre><code class=\"language-cpp\">#include &lt;stdio.h&gt;\r\nint main()\r\n{\r\n    float number1 = 13.5;\r\n    double number2 = 12.4;\r\n\r\n    printf(\"number1 = %f\\n\", number1);\r\n    printf(\"number2 = %lf\", number2);\r\n    return 0;\r\n}</code></pre><p><strong>Output</strong></p><pre><code>number1 = 13.500000\r\nnumber2 = 12.400000</code></pre><p>To print&nbsp;<code>float</code>, we use&nbsp;<code>%f</code>&nbsp;format specifier. Similarly, we use&nbsp;<code>%lf</code>&nbsp;to print&nbsp;<code>double</code>&nbsp;values.</p><p>&nbsp;</p><p><em><strong>Example 4: Print Characters</strong></em></p><pre><code class=\"language-cpp\">#include &lt;stdio.h&gt;\r\nint main()\r\n{\r\n    char chr = \'a\';    \r\n    printf(\"character = %c\", chr);  \r\n    return 0;\r\n} </code></pre><p><strong>Output</strong></p><pre><code>character = a\r\n</code></pre><p>To print&nbsp;<code>char</code>, we use&nbsp;<code>%c</code>&nbsp;format specifier.</p><p>&nbsp;</p><p><em><strong>C Input</strong></em></p><p>In C programming,&nbsp;<code>scanf()</code>&nbsp;is one of the commonly used function to take input from the user. The&nbsp;<code>scanf()</code>&nbsp;function reads formatted input from the standard input such as keyboards.</p><p><strong>Example 5: Integer Input/Output</strong></p><pre><code class=\"language-cpp\">#include &lt;stdio.h&gt;\r\nint main()\r\n{\r\n    int testInteger;\r\n    printf(\"Enter an integer: \");\r\n    scanf(\"%d\", &amp;testInteger);  \r\n    printf(\"Number = %d\",testInteger);\r\n    return 0;\r\n}</code></pre><p><strong>Output</strong></p><pre><code>Enter an integer: 4\r\nNumber = 4</code></pre><p>Here, we have used&nbsp;<code>%d</code>&nbsp;format specifier inside the&nbsp;<code>scanf()</code>&nbsp;function to take&nbsp;<code>int</code>&nbsp;input from the user. When the user enters an integer, it is stored in the&nbsp;testInteger&nbsp;variable.</p><p>&nbsp;</p><p><strong>Example 6: C Character I/O</strong></p><pre><code class=\"language-cpp\">#include &lt;stdio.h&gt;\r\nint main()\r\n{\r\n    char chr;\r\n    printf(\"Enter a character: \");\r\n    scanf(\"%c\",&amp;chr);     \r\n    printf(\"You entered %c.\", chr);  \r\n    return 0;\r\n}  </code></pre><p><strong>Output</strong></p><pre><code>Enter a character: g\r\nYou entered g</code></pre><p>When a character is entered by the user in the above program, the character itself is not stored. Instead, an integer value (ASCII value) is stored.</p><p>And when we display that value using&nbsp;<code>%c</code>&nbsp;text format, the entered character is displayed. If we use&nbsp;<code>%d</code>&nbsp;to display the character, it&#39;s ASCII value is printed.</p><p>&nbsp;</p><p><em><strong>I/O Multiple Values</strong></em></p><p>&nbsp;</p><pre><code class=\"language-cpp\">#include &lt;stdio.h&gt;\r\nint main()\r\n{\r\n    int a;\r\n    float b;\r\n\r\n    printf(\"Enter integer and then a float: \");\r\n  \r\n    // Taking multiple inputs\r\n    scanf(\"%d%f\", &amp;a, &amp;b);\r\n\r\n    printf(\"You entered %d and %f\", a, b);  \r\n    return 0;\r\n}</code></pre><p><strong>Output</strong></p><pre><code>Enter integer and then a float: -3\r\n3.4\r\nYou entered -3 and 3.400000</code></pre><p>&nbsp;</p><p><em><strong>Format Specifiers for I/O</strong></em></p><p>As you can see from the above examples, we use</p><ol><li><code>%d</code>&nbsp;for&nbsp;<code>int</code></li><li><code>%f</code>&nbsp;for&nbsp;<code>float</code></li><li><code>%lf</code>&nbsp;for&nbsp;<code>double</code></li><li><code>%c</code>&nbsp;for&nbsp;<code>char</code></li></ol>'),
(13, 2, 'C Programming Operators', 'In this tutorial, you will learn about different operators in C programming with the help of examples.', '<p>An operator is a symbol that operates on a value or a variable. For example:&nbsp;+&nbsp;is an operator to perform addition.</p><p>C has a wide range of operators to perform various operations.</p><p>&nbsp;</p><p>C Arithmetic Operators</p><p>An arithmetic operator performs mathematical operations such as addition, subtraction, multiplication, division etc on numerical values (constants and variables).</p><table border=\"0\"><thead><tr><th>Operator</th><th>&nbsp; &nbsp;Meaning of Operator</th></tr></thead><tbody><tr><td>+</td><td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;addition or unary plus</td></tr><tr><td>-</td><td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;subtraction or unary minus</td></tr><tr><td>*</td><td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;multiplication</td></tr><tr><td>/</td><td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;division</td></tr><tr><td>%&nbsp;</td><td>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;remainder after division (modulo division)</td></tr></tbody></table><p>&nbsp;</p><p><em><strong>Example 1: Arithmetic Operators</strong></em></p><pre><code class=\"language-cpp\">// Working of arithmetic operators\r\n#include \r\nint main()\r\n{\r\n    int a = 9,b = 4, c;\r\n    \r\n    c = a+b;\r\n    printf(\"a+b = %d \",c);\r\n    c = a-b;\r\n    printf(\"a-b = %d \",c);\r\n    c = a*b;\r\n    printf(\"a*b = %d \",c);\r\n    c = a/b;\r\n    printf(\"a/b = %d \",c);\r\n    c = a%b;\r\n    printf(\"Remainder when a divided by b = %d \",c);\r\n    \r\n    return 0;\r\n}</code></pre><p><strong>Output</strong></p><pre><code>a+b = 13\r\na-b = 5\r\na*b = 36\r\na/b = 2\r\nRemainder when a divided by b=1</code></pre><p>The operators&nbsp;<code>+</code>,&nbsp;<code>-</code>&nbsp;and&nbsp;<code>*</code>&nbsp;computes addition, subtraction, and multiplication respectively as you might have expected.</p><p>In normal calculation,&nbsp;<code>9/4 = 2.25</code>. However, the output is&nbsp;<code>2</code>&nbsp;in the program.</p><p>It is because both the variables&nbsp;a&nbsp;and b are integers. Hence, the output is also an integer. The compiler neglects the term after the decimal point and shows answer&nbsp;<code>2</code>&nbsp;instead of&nbsp;<code>2.25</code>.</p><p>The modulo operator&nbsp;<code>%</code>&nbsp;computes the remainder. When&nbsp;<code>a=9</code>&nbsp;is divided by&nbsp;<code>b=4</code>, the remainder is&nbsp;<code>1</code>. The&nbsp;<code>%</code>&nbsp;operator can only be used with integers.</p><p>&nbsp;</p><p><em><strong>C Increment and Decrement Operators</strong></em></p><p>C programming has two operators increment&nbsp;<code>++</code>&nbsp;and decrement&nbsp;<code>--</code>&nbsp;to change the value of an operand (constant or variable) by 1.</p><p>Increment&nbsp;<code>++</code>&nbsp;increases the value by 1 whereas decrement&nbsp;<code>--</code>&nbsp;decreases the value by 1. These two operators are unary operators, meaning they only operate on a single operand.</p><p><em><strong>Example 2: Increment and Decrement Operators</strong></em></p><pre><code class=\"language-cpp\">// Working of increment and decrement operators\r\n#include \r\nint main()\r\n{\r\n    int a = 10, b = 100;\r\n    float c = 10.5, d = 100.5;\r\n\r\n    printf(\"++a = %d \", ++a);\r\n    printf(\"--b = %d \", --b);\r\n    printf(\"++c = %f \", ++c);\r\n    printf(\"--d = %f \", --d);\r\n\r\n    return 0;\r\n}</code></pre><p><strong>Output</strong></p><pre><code>++a = 11\r\n--b = 99\r\n++c = 11.500000\r\n--d = 99.500000</code></pre><p>Here, the operators&nbsp;<code>++</code>&nbsp;and&nbsp;<code>--</code>&nbsp;are used as prefixes. These two operators can also be used as postfixes like&nbsp;<code>a++</code>&nbsp;and&nbsp;<code>a--</code>.&nbsp;</p><p>&nbsp;</p><p><em><strong>C Assignment Operators</strong></em></p><p>An assignment operator is used for assigning a value to a variable. The most common assignment operator is&nbsp;<code>=</code></p><table border=\"0\"><thead><tr><th>Operator</th><th>&nbsp; &nbsp; Example</th><th>&nbsp; &nbsp; &nbsp;Same as</th></tr></thead><tbody><tr><td>&nbsp; &nbsp; &nbsp;=</td><td>&nbsp; &nbsp; &nbsp;a = b</td><td>&nbsp; &nbsp; &nbsp; a = b</td></tr><tr><td>&nbsp; &nbsp; +=</td><td>&nbsp; &nbsp; &nbsp;a += b</td><td>&nbsp; &nbsp; &nbsp; a = a+b</td></tr><tr><td>&nbsp; &nbsp; &nbsp;-=</td><td>&nbsp; &nbsp; &nbsp;a -= b&nbsp;&nbsp;</td><td>&nbsp; &nbsp; &nbsp; a = a-b</td></tr><tr><td>&nbsp; &nbsp; &nbsp;*=</td><td>&nbsp; &nbsp; &nbsp;a *= b</td><td>&nbsp; &nbsp; &nbsp; a = a*b</td></tr><tr><td>&nbsp; &nbsp; &nbsp;/=</td><td>&nbsp; &nbsp; &nbsp;a /= b</td><td>&nbsp; &nbsp; &nbsp; a = a/b</td></tr><tr><td>&nbsp; &nbsp; %=</td><td>&nbsp; &nbsp; &nbsp;a %= b</td><td>&nbsp; &nbsp; &nbsp; a = a%b</td></tr></tbody></table><p><strong>Example 3: Assignment Operators</strong></p><pre><code class=\"language-cpp\">// Working of assignment operators\r\n#include \r\nint main()\r\n{\r\n    int a = 5, c;\r\n\r\n    c = a;      // c is 5\r\n    printf(\"c = %d\", c);\r\n    c += a;     // c is 10 \r\n    printf(\"c = %d\", c);\r\n    c -= a;     // c is 5\r\n    printf(\"c = %d\", c);\r\n    c *= a;     // c is 25\r\n    printf(\"c = %d\", c);\r\n    c /= a;     // c is 5\r\n    printf(\"c = %d\", c);\r\n    c %= a;     // c = 0\r\n    printf(\"c = %d\", c);\r\n\r\n    return 0;\r\n}</code></pre><p><strong>Output</strong></p><pre><code>c = 5 \r\nc = 10 \r\nc = 5 \r\nc = 25 \r\nc = 5 \r\nc = 0</code></pre><p>&nbsp;</p>');

